import Card, {
  PinkCard,
  InfoPackWithButton,
  TopBar,
  BottomBar,
  PhishingExamples,
  Facts,
  Image,
  Remember,
  InformationCard,
  SmallButton,
} from "./Components.js";
import "./App.css";
import { useNavigate } from "react-router-dom";
import { useState, useEffect } from "react";
import React from "react";

function DigitalPrivacyScreen() {
  const navigate = useNavigate();

  const [isMobile, setIsMobile] = useState(window.innerWidth < 768);

  useEffect(() => {
    const handleResize = () => setIsMobile(window.innerWidth < 768);
    window.addEventListener("resize", handleResize);
    return () => window.removeEventListener("resize", handleResize);
  }, []);

  return (
    <>
      <TopBar />
      <div
        style={{
          display: "flex",
          flexDirection: isMobile ? "column" : "row",
          alignItems: "center",
          justifyContent: "center",
          minHeight: isMobile ? "60vh" : "100vh",
          textAlign: "center",
          gap: isMobile ? "20px" : "40px",
          padding: isMobile ? "20px" : "0",
        }}
        className="background-color-verylightorange"
      >
        <div>
          <h1
            className={isMobile ? "muwatana-header-styling" : ""}
            style={{
              fontSize: isMobile ? "30px" : "45px",
              color: "#ff6933",
            }}
          >
            Digital Privacy
          </h1>
          {isMobile ? (
            <p>
              Digital privacy is your right to keep your personal information
              private in the digital world.
            </p>
          ) : (
            <p style={{ fontSize: isMobile ? "14px" : "inherit" }}>
              Digital privacy is your right to keep your personal information
              private in the digital world.
            </p>
          )}
        </div>
        <div>
          <img
            src={"Phishing-Email--Streamline-Milano.png"}
            alt="security"
            className="image-styling"
            style={{
              maxWidth: isMobile ? "80%" : "400px",
              height: "auto",
              margin: "0 auto",
            }}
          />
        </div>
      </div>
      <div>
        <InformationCard
          title={
            <div style={{ textAlign: "center" }}>
              The dangers of poor
              <br />
              digital privacy
            </div>
          }
          words={["Cyberattacks", "Blackmail", "Cyberstalking"]}
        />
      </div>
      <div>
        <Remember
          style={{ paddingBottom: "20px" }}
          source={
            "https://www.cisco.com/c/en/us/products/security/secure-access/phishing-for-dummies.html"
          }
          title={<>Privacy essentials</>}
          content={
            <>
              <ul>
                <li>
                  Anything you put on the internet is now public information,
                  and you may be unable to delete it.
                </li>
                <li>
                  When you post photos of your child on public social media
                  accounts, you are doing this without their consent.
                </li>
              </ul>
            </>
          }
        />
      </div>
      <div
        style={{
          display: "flex",
          justifyContent: "center",
          alignItems: "center",
        }}
      >
        <div
          style={{
            border: "none",
            backgroundColor: "rgb(247, 234, 236)",
            justifyContent: "center",
            display: "flex",
            flexDirection: "column",
            alignItems: "center",
            maxWidth: "fit-content",
            borderRadius: "17px",
            margin: "40px",
            minHeight: "750px",
            height: "auto",
            padding: "40px 50px",
            boxShadow: "0px 4px 5px rgba(0, 0, 0, 0.3)",
          }}
        >
          <h1 style={{ fontSize: "45px", textAlign: "center", width: "100%" }}>
            To maintain digital privacy{" "}
          </h1>
          <InfoPackWithButton
            picture={"Vector.png"}
            title={<>Use a strong and unique password</>}
            description={
              <>
                Use a strong password on all your accounts (social media, email,
                instant messaging, etc.) and do not
                <br />
                use the same password for multiple accounts.
              </>
            }
          />
          <SmallButton text={"Learn how to create a strong password"} />
          <InfoPackWithButton
            picture={"Vector.png"}
            title={<>Keep your password a secret</>}
            description={
              <>
                Do not share your password with others and do not enter your
                password in front of others. If you think
                <br />
                your account has been infiltrated, change your password
                immediately.
              </>
            }
          />
          <SmallButton
            text={"Learn how to keep your password private from others"}
          />
          <InfoPackWithButton
            picture={"Vector.png"}
            title={<>Protect your account case</>}
            description={
              <>
                Log out of your account after using it on a device that is not
                yours.
              </>
            }
          />
          <SmallButton text={"Learn how to protect your account from others"} />
          <InfoPackWithButton
            picture={"Vector.png"}
            title={<>Take advantage of security settings</>}
            description={
              <>
                Set up security & privacy settings in your account, such as
                limiting those who can see your posts to
                <br />
                "friends only", using two-factor authentication, and setting up
                spam protection
              </>
            }
          />
          <SmallButton text={"Learn how to set up privacy and security"} />
        </div>
      </div>
      <div
        className="resources-part-styling"
        style={{
          justifyContent: "center",
          paddingTop: "20px",
          paddingBottom: "60px",
        }}
      >
        <h1>Related Topics</h1>
        <div className="pinkcard-row-styling">
          <PinkCard
            title={
              <>
                Setting up 2-Factor
                <br />
                Authentication
              </>
            }
            content={
              <>
                Keep your account safe with
                <br />
                an extra security step.
              </>
            }
          />
          <PinkCard
            title={
              <>
                Creating a <br />
                password
              </>
            }
            content={
              <>
                Learn how to create a<br />
                strong, safe password.
              </>
            }
          />
        </div>
      </div>
      <BottomBar />
    </>
  );
}

export default DigitalPrivacyScreen;
